function calculateMicrostripAntenna(){var e=1e9*parseFloat(document.getElementById("frequency").value),t=parseFloat(document.getElementById("epsilon_r").value),$=parseFloat(document.getElementById("height").value)/1e3,n=parseFloat(document.getElementById("zo").value),l=parseFloat(document.getElementById("elecLength").value),_=n/60*Math.sqrt((t+1)/2)+(t-1)/(t+1)*(.23+.11/t),r=8*$*Math.exp(_)/(Math.exp(2*_)-2);document.getElementById("results").innerHTML="Width (W) = "+(1e3*r).toFixed(6)+" mm<br>Length (L) = "+(1e3*(299792458/(e*Math.sqrt((t+1)/2+(t-1)/2*(1/Math.sqrt(1+12*($/r)))))*(l/360))).toFixed(6)+" mm<br>"}